/*****base colors*****/
/*********************/
/****scheme colors****/
/*********************/
atom-text-editor,
:host {
  background-color: #e9e6e7;
  color: #433b3e;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #dfdbdd;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #dfdbdd;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #ffffff;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #e9e6e7;
  color: #c5bdc0;
  border-right: 1px solid #dfdbdd;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #f0eeef;
  color: #8fd5b1;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #8fd5b1;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #b7adb0;
}
atom-text-editor .invisible,
:host .invisible {
  color: #433b3e;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ac2072;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #c7ead8;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #ffffff;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #7dcea4;
}
atom-text-editor::shadow .bracket-matcher .region {
  border-radius: 2px;
  border: 1px solid white;
  background: rgba(255, 255, 255, 0.6);
}
.entity.name.tag {
  color: #00aa7b;
}
.entity.name.tag .string {
  color: #aa5587;
}
.punctuation.definition.tag {
  color: #007756;
}
.sgml .punctuation.definition.tag {
  color: #433b3e;
}
.source.css.less .variable,
.source.css.sass .variable,
.source.css.scss .variable {
  color: #00aa7b;
}
.source.css .entity.other.attribute-name {
  color: #00aa7b;
}
.source.css .punctuation.definition.entity {
  color: #814066;
}
.source.css .constant.other.color,
.source.css .constant.other.rgb-value {
  color: #d7288e;
}
.source.css .constant.other.color.scss .punctuation.definition,
.source.css .constant.other.rgb-value.scss .punctuation.definition {
  color: #ac2072;
}
.source.css.scss .punctuation {
  color: #433b3e;
}
.source.css.scss .entity.tag {
  color: #aa5587;
}
.source.js .storage {
  color: #00aa7b;
}
.source.js .storage.arrow {
  color: #d7288e;
}
.source.js .string.template .embedded,
.source.js .string.template .embedded.punctuation {
  color: #814066;
}
.source.js.jsx .tag .entity.name,
.source.js.jsx .tag .punctuation.definition.tag {
  color: #007756;
}
.source.js.jsx .tag .meta.brace.curly,
.source.js.jsx .tag .meta.brace.curly .constant,
.source.js.jsx .tag .meta.brace.curly .variable {
  color: #aa5587;
}
.source.coffee .storage.function {
  color: #d7288e;
}
.source.coffee .string.quoted.double .embedded,
.source.coffee .string.quoted.double .embedded.punctuation {
  color: #814066;
}
.source.coffee .meta.function .entity.name.function {
  font-weight: bold;
}
.source.coffee .entity.name.function {
  font-weight: normal;
}
.source.coffee .variable.instance,
.source.coffee .variable.instance .punctuation.definition {
  color: #007756;
}
.source.gfm .markup.heading.heading-1 {
  color: #00aa7b;
}
.source.gfm .markup.heading.heading-2 {
  color: #00aa97;
}
.source.gfm .markup.heading.heading-3 {
  color: #00a0aa;
}
.source.gfm .markup.heading.heading-4 {
  color: #0084aa;
}
.source.gfm .markup.heading.heading-5 {
  color: #0068aa;
}
.source.gfm .markup.heading.heading-6 {
  color: #004baa;
}
.source.gfm .link {
  color: #d7288e;
}
.source.gfm .list {
  color: #ac2072;
}
.source.gfm .support {
  background: #aa5587;
  color: #e9e6e7;
  border-radius: 3px;
}
.source.gfm .quote {
  color: #433b3e;
}
.source.gfm .quote .support {
  color: #e9e6e7;
  border-radius: 0;
}
.source.gfm .table .border.pipe,
.source.gfm .table .border.header {
  color: #00aa7b;
}
.source.gfm .table .border.alignment {
  color: #d7288e;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.link {
  color: #ac2072;
}
.source.gfm .markup.bold {
  color: #433b3e;
  font-weight: bold;
}
.source.gfm .markup.italic {
  color: #433b3e;
  font-style: italic;
}
.source.gfm .markup.strike {
  text-decoration: line-through;
}
.source.gfm .markup.raw {
  background: rgba(255, 255, 255, 0.35);
  border: 1px solid #c5bdc0;
  border-radius: 6px;
}
.source.json .string {
  color: #d7288e;
}
.source.json .meta.structure .punctuation.separator {
  color: black;
}
.source.json .punctuation.definition {
  color: #ac2072;
}
.source.json .punctuation.definition.dictionary,
.source.json .punctuation.definition.array {
  color: black;
}
.source.ruby .string.double.quoted .embedded {
  color: #814066;
}
.source.ruby .punctuation.separator.variable,
.source.ruby .variable.block {
  color: #d7288e;
}
.source.ruby .variable.instance {
  color: #007756;
}
.source.ruby .variable.instance .punctuation.definition {
  color: #00aa7b;
}
.source.ruby .punctuation.inheritance {
  color: #ac2072;
}
.source.ruby .constant.symbol {
  color: #aa5587;
}
.source.ruby .constant.symbol .punctuation.definition {
  color: #814066;
}
.keyword {
  color: #00aa7b;
}
.keyword.regexp {
  color: #d7288e;
}
.keyword.operator {
  color: #433b3e;
}
.keyword.operator.regexp {
  color: #d7288e;
}
.keyword.other.unit {
  color: #d7288e;
}
.storage {
  color: #d7288e;
}
.string {
  color: #aa5587;
}
.entity.name.function {
  font-weight: bold;
}
.constant {
  color: #433b3e;
}
.constant.character.escape {
  color: #00aa7b;
}
.constant.numeric {
  color: #ac2072;
}
.constant.boolean {
  color: #d7288e;
}
.comment {
  color: #c5bdc0;
  font-style: italic;
}
.variable {
  color: #433b3e;
}
.variable.parameter {
  font-style: italic;
}
.punctuation.definition.comment {
  color: #c5bdc0;
}
.punctuation.definition.parameters {
  font-style: italic;
}
.punctuation.definition.string,
.punctuation.definition.array {
  color: #aa5587;
}
.invalid.illegal {
  background-color: #ac2072;
  color: #e9e6e7;
}
